import React from 'react';

const Contact = () => (
  <section className="contact">
    <h2>Contact</h2>
    <p>Email: <a href="mailto:jordan.d.kelley1@gmail.com">jordan.d.kelley1@gmail.com</a></p>
    <p>GitHub: <a href="https://github.com/JKelleyDev">JKelleyDev</a></p>
    <p>LinkedIn: <a href="https://linkedin.com/in/jordan.kelley">Jordan Kelley</a></p>
  </section>
);

export default Contact;
